            image.removeBackground();
            navigate("Next")
        }
    }

    return(
        <div>
            <button onClick={startRemoveBackground}>Remove that background!</button>
                {image?.capturedImage && (
                <img src={image.capturedImage} alt="Background removed" />
            )}
        </div>
    )
}

